import React from 'react';
import Navbar from 'react-bootstrap/Navbar';
import "./style.css";
import { useHistory } from "react-router-dom";
import ContactContext from "../../utils/ContactContext";

function Index(props) {
  const history = useHistory();
  const [contactTimer, setContactTimer] = React.useContext(ContactContext);

  const handleClick = (event) => {
    event.preventDefault();
    history.push('/')
  }

    return (
        <div>
          <Navbar bg="light" variant="dark" className="navBar">
            <Navbar.Brand 
              href="#"
              onClick={handleClick}
            >
              <img 
                src={require("../../assets/RE.png")} 
                alt="re-logo"
                id="re-logo"
              />
            </Navbar.Brand>
            {/* <Nav className="mr-auto">
              <Nav.Link href="/home">Contact</Nav.Link>
            </Nav> */}
            <div 
              className="nav-contact"
              onClick={setContactTimer(true)}
            >
              <p>Contact</p>
            </div>
          </Navbar>
        </div>
    );
}

export default Index;
